import React from 'react'
import { ICustomer } from '../interfaces'

type CustomerListProps = {
    customers: ICustomer[]
}

export const CustomerList: React.FC<CustomerListProps> = ({customers}) => {
    return (
        <table>
        <thead>
          <tr>
              <th>Name</th>
              <th>Item Name</th>
              <th>Item Price</th>
          </tr>
        </thead>
        <tbody>
            {customers.map(customer => {
                    return (
                      <tr>
                        <td>{customer.id}</td>
                        <td>{customer.name}</td>
                        <td>{customer.phone}</td>
                      </tr>
                    )
                })
            }
        </tbody>
      </table>
    )
}
